Adding ArrayFire to an existing application is slightly more involved and can be somewhat tricky due to several optimizations we implement. The most important are as follows: ArrayFire assumes control of all memory provided to it. ArrayFire does not (in general) support in-place memory transactions. We will discuss the implications of these items below. To add ArrayFire to existing code you need to: Finish any pending CUDA operations (e.g. cudaDeviceSynchronize() or similar stream functions) Create ArrayFire arrays from existing CUDA pointers Perform operations on ArrayFire arrays Instruct ArrayFire to finish operations using eval and sync Obtain pointers to important memory Continue your CUDA application. Free non-managed memory To create the Array fom device pointer, you should use one of the following approaches: Using DeviceBuffer from RustaCUDA , or a Wrapper Object for CUDA device memory let mut buffer = memory::DeviceBuffer::from_slice(&v).unwrap(); let array_dptr = Array::new_from_device_ptr( buffer.as_device_ptr().as_raw_mut(), dim4!(10, 10)); array_dptr.lock(); // Needed to avoid free as arrayfire takes ownership Using raw pointer returned from cuda_malloc interface exposed by RustaCUDA let mut dptr: *mut f32 = std::ptr::null_mut();
unsafe { dptr = memory::cuda_malloc::<f32>(10*10).unwrap().as_raw_mut();
} let array_dptr = Array::new_from_device_ptr(dptr, dim4!(10, 10));
// After ArrayFire takes over ownership of the pointer, you can use other
// arrayfire functions as usual. ArrayFire's memory manager automatically assumes responsibility for any memory provided to it. Thus ArrayFire could free or reuse the memory at any later time. If this behavior is not desired, you may call Array::unlock and manage the memory yourself. However, if you do so, please be cautious not to free memory when ArrayFire might be using it! The seven steps above are best illustrated using a fully-worked example: use arrayfire::{af_print, dim4, info, set_device, Array};
use rustacuda::prelude::*;
use rustacuda::*; fn main() { // MAKE SURE to do all rustacuda initilization before arrayfire API's // first call. It seems like some CUDA context state is getting messed up // if we mix CUDA context init(device, context, module, stream) with ArrayFire API match rustacuda::init(CudaFlags::empty()) { Ok(()) => {} Err(e) => panic!("rustacuda init failure: {:?}", e), } let device = match Device::get_device(0) { Ok(d) => d, Err(e) => panic!("Failed to get device: {:?}", e), }; let _context = match Context::create_and_push(ContextFlags::MAP_HOST | ContextFlags::SCHED_AUTO, device) { Ok(c) => c, Err(e) => panic!("Failed to create context: {:?}", e), }; let stream = match Stream::new(StreamFlags::NON_BLOCKING, None) { Ok(s) => s, Err(e) => panic!("Failed to create stream: {:?}", e), }; let mut in_x = DeviceBuffer::from_slice(&[1.0f32; 10]).unwrap(); let mut in_y = DeviceBuffer::from_slice(&[2.0f32; 10]).unwrap(); // wait for any prior kernels to finish before passing // the device pointers to ArrayFire match stream.synchronize() { Ok(()) => {} Err(e) => panic!("Stream sync failure: {:?}", e), }; set_device(0); info(); let x = Array::new_from_device_ptr(in_x.as_device_ptr().as_raw_mut(), dim4!(10)); let y = Array::new_from_device_ptr(in_y.as_device_ptr().as_raw_mut(), dim4!(10)); // Lock so that ArrayFire doesn't free pointers from RustaCUDA // But we have to make sure these pointers stay in valid scope // as long as the associated ArrayFire Array objects are valid x.lock(); y.lock(); af_print!("x", x); af_print!("y", y); let o = x + y; af_print!("out", o); let _o_dptr = unsafe { o.device_ptr() }; // Calls an implicit lock // User has to call unlock if they want to relenquish control to ArrayFire // Once the non-arrayfire operations are done, call unlock. o.unlock(); // After this, there is no guarantee that value of o_dptr is valid
}

