By default, ArrayFire manages its own context, queue, memory, and creates custom IDs for devices. Thus there is some bookkeeping that needs to be done to integrate your custom OpenCL kernel. If your kernels can share operate in the same queue as ArrayFire, you should: Obtain the OpenCL context, device, and queue used by ArrayFire Obtain cl_mem references to Array objects Load, build, and use your kernels Return control of Array memory to ArrayFire Note, ArrayFire uses an in-order queue, thus when ArrayFire and your kernels are operating in the same queue, there is no need to perform any synchronization operations. This process is best illustrated with a fully worked example: //! A trivial example. Copied from ocl-core crate repository.
use af_opencl_interop as afcl;
use arrayfire as af; use ocl_core::{ArgVal, Event}; use std::ffi::CString; fn main() { af::info(); let dims = af::dim4!(8); let af_buffer = af::constant(0f32, dims.clone()); af::af_print!("af_buffer", af_buffer); let src = r#" __kernel void add(__global float* buffer, float scalar) { buffer[get_global_id(0)] += scalar; } "#; let af_did = afcl::get_device_id(); let af_ctx = afcl::get_context(false); let af_que = afcl::get_queue(false); let devid = unsafe { ocl_core::DeviceId::from_raw(af_did) }; let contx = unsafe { ocl_core::Context::from_raw_copied_ptr(af_ctx) }; let queue = unsafe { ocl_core::CommandQueue::from_raw_copied_ptr(af_que) }; // Define which platform and device(s) to use. Create a context, // queue, and program then define some dims.. let src_cstring = CString::new(src).unwrap(); let program = ocl_core::create_program_with_source(&contx, &[src_cstring]).unwrap(); ocl_core::build_program( &program, None::<&[()]>, &CString::new("").unwrap(), None, None, ) .unwrap(); // Fetch cl_mem from ArrayFire Array let ptr = unsafe { af_buffer.device_ptr() }; let buffer = unsafe { ocl_core::Mem::from_raw_copied_ptr(ptr) }; // Create a kernel with arguments matching those in the source above: let kernel = ocl_core::create_kernel(&program, "add").unwrap(); ocl_core::set_kernel_arg(&kernel, 0, ArgVal::mem(&buffer)).unwrap(); ocl_core::set_kernel_arg(&kernel, 1, ArgVal::scalar(&10.0f32)).unwrap(); let ocl_dims: [usize; 3] = [dims[0] as usize, dims[1] as usize, dims[2] as usize]; unsafe { ocl_core::enqueue_kernel( &queue, &kernel, 1, None, &ocl_dims, None, None::<Event>, None::<&mut Event>, ) .unwrap(); } ocl_core::finish(&queue).unwrap(); af_buffer.unlock(); //Give back control of cl_mem to ArrayFire memory manager af::af_print!("af_buffer after running Custom Kernel on it", af_buffer);
} If your kernels needs to operate in their own OpenCL queue, the process is essentially identical, except you need to instruct ArrayFire to complete its computations using the sync function prior to launching your own kernel and ensure your kernels are complete using clFinish (or similar) commands prior to returning control of the memory to ArrayFire: Obtain the OpenCL context, device, and queue used by ArrayFire Obtain cl_mem references to Array objects Instruct ArrayFire to finish operations using sync Load, build, and use your kernels Instruct OpenCL to finish operations using clFinish() or similar commands. Return control of Array memory to ArrayFire

