Adding ArrayFire to an existing application is slightly more involved and can be somewhat tricky due to several optimizations we implement. The most important are as follows: ArrayFire assumes control of all memory provided to it. ArrayFire does not (in general) support in-place memory transactions. We will discuss the implications of these items below. To add ArrayFire to existing code you need to: Instruct OpenCL to complete its operations using clFinish (or similar) Instruct ArrayFire to use the user-created OpenCL Context Create ArrayFire arrays from OpenCL memory objects Perform ArrayFire operations on the Array s Instruct ArrayFire to finish operations using sync Obtain cl_mem references for important memory Continue your OpenCL application ArrayFire's memory manager automatically assumes responsibility for any memory provided to it. If you are creating an array from another RAII style object, you should retain it to ensure your memory is not deallocated if your RAII object were to go out of scope. If you do not wish for ArrayFire to manage your memory, you may call the Array::unlock function and manage the memory yourself; however, if you do so, please be cautious not to call clReleaseMemObj on a cl_mem when ArrayFire might be using it! Given below is a fully working example: //! A trivial example. Copied from ocl-core crate repository.
use af_opencl_interop as afcl;
use arrayfire as af; use ocl_core::{ContextProperties, Event}; fn main() { // Choose platform & device(s) to use. Create a context, queue, let platform_id = ocl_core::default_platform().unwrap(); let device_ids = ocl_core::get_device_ids(&platform_id, None, None).unwrap(); let device_id = device_ids[0]; let context_properties = ContextProperties::new().platform(platform_id); let context = ocl_core::create_context(Some(&context_properties), &[device_id], None, None).unwrap(); let queue = ocl_core::create_command_queue(&context, &device_id, None).unwrap(); let dims = [8, 1, 1]; // Create a `Buffer`: let mut vec = vec![0.0f32; dims[0]]; let buffer = unsafe { ocl_core::create_buffer( &context, ocl_core::MEM_READ_WRITE | ocl_core::MEM_COPY_HOST_PTR, dims[0], Some(&vec), ) .unwrap() }; ocl_core::finish(&queue).unwrap(); //sync up before switching to arrayfire // Add custom device, context and associated queue to ArrayFire afcl::add_device_context(device_id.as_raw(), context.as_ptr(), queue.as_ptr()); afcl::set_device_context(device_id.as_raw(), context.as_ptr()); af::info(); let mut af_buffer = af::Array::new_from_device_ptr( buffer.as_ptr() as *mut f32, af::Dim4::new(&[dims[0] as u64, 1, 1, 1]), ); af::af_print!("GPU Buffer before modification:", af_buffer); af_buffer = af_buffer + 10f32; af::sync(af::get_device()); unsafe { let ptr = af_buffer.device_ptr(); let obuf = ocl_core::Mem::from_raw_copied_ptr(ptr); // Read results from the device into a vector: ocl_core::enqueue_read_buffer( &queue, &obuf, true, 0, &mut vec, None::<Event>, None::<&mut Event>, ) .unwrap(); } println!("GPU buffer on host after ArrayFire operation: {:?}", vec); // Remove device from ArrayFire management towards Application Exit af::set_device(0); // Cannot pop when in Use, hence switch to another device afcl::delete_device_context(device_id.as_raw(), context.as_ptr());
}

