By its very nature, ArrayFire is a vectorized library. Most functions operate on Arrays as a whole i.e. on all elements in parallel. For example consider the following code: let mut a = af::range(Dim::new(&[10, 1, 1, 1])); // [0, 9]
a = a + 1; // [1, 10] This code will result in a single kernel that operates on all 10 elements of a in parallel. A small subset of such vectorized ArrayFire functions are given below for quick reference: Operator Category Functions Arithmetic operations +, -, *, /, %, >>, << Logical operations &&, ||, <, >, ==, != etc. Numeric functions abs , floor , round , min , max , etc. Complex operations real , imag , conjg , etc. Exponential and logarithmic fns exp , log , expm1 , log1p , etc. Trigonometric functions sin , cos , tan , etc. Hyperbolic functions sinh , cosh , tanh , etc. In addition to element-wise operations, many other functions are also vectorized in ArrayFire. Notice that even functions that perform some form of aggregation (e.g. sum or min ), signal processing (like convolve ), and image processing functions (i.e. rotate etc.) all support vectorization on different columns or images. For example, if we have NUM images of size WIDTHxHEIGHT, one could convolve each image in a vector fashion as follows: let g_coef: [f32, 9] = { 1, 2, 1, 2, 4, 2, 1, 2, 1 }; let f = Array::new(g_coef, Dim4::new(&[3, 3, 1, 1]));
let filter = f * 1.0f32/16; let signal = randu(WIDTH, HEIGHT, NUM);
let conv = convolve2(signal, filter, ConvMode::DEFAULT, ConvDomain::AUTO); Similarly, one can rotate 100 images by 45 degrees in a single call using code like the following: // Construct an array of 100 WIDTH x HEIGHT images of random numbers
let imgs = randu(WIDTH, HEIGHT, 100); // Rotate all of the images in a single command
let rot_imgs = rotate(imgs, 45.0, False, InterpType::LINEAR); Although most functions in ArrayFire do support vectorization, some do not. Most notably, all linear algebra functions. Even though they are not vectorized linear algebra operations, they still execute in parallel on your hardware. Using the built in vectorized operations should be the first and preferred method of vectorizing any code written with ArrayFire.
